// Cycle trough 0x2301 Forced Set/Reset Message
let i = 2;
for (; i < inData.byteLength;i+=6) {

    let setResetSpes = inData.readUInt16BE(i);
    let memAreaCode = inData.readUInt8(i + 2);
    let addr = inData.readUInt16BE(i + 3);
    let bitFlag = inData.readUInt8(i + 4);

    // Look up data
    if (memAreaCode == 49) {          // CS1 0x31

        if (addr == 0) {              // W0

            // W0.0 - SoftJS_Hor_CCW_input (JS Left)
            // W0.1 - SoftJS_Hor_CW_Input (JS Right)
            // W0.7 - Hor_Sweep_Panel
            if (setResetSpes & 0x0001) {
                regW.W0 |= (0x0001 << bitFlag);  // Set W0.bitFlag
            } else {
                regW.W0 &= ~(0x0001 << bitFlag);  // Clear W0.bitFlag
            }

        } else if (addr == 10) {       // W10

            // W10.0 - SoftJS_Vert_CCW_input (JS Down)
            // W10.1 - SoftJS_Vert_CW_input (JS Up)
            if (setResetSpes & 0x0001) {
                regW.W10 |= (0x0001 << bitFlag);  // Set W10.bitFlag
            } else {
                regW.W10 &= ~(0x0001 << bitFlag);  // Clear W10.bitFlag
            }

        } else if (addr == 20) {       // W20

            // W20.0 - Focus_Pos_Panel
            // W20.1 - Focus_Neg_Panel
            if (setResetSpes & 0x0001) {
                regW.W20 |= (0x0001 << bitFlag);  // Set W20.bitFlag
            } else {
                regW.W20 &= ~(0x0001 << bitFlag);  // Clear W20.bitFlag
            }

        } else if (addr == 70) {      // W70

            // W70.6 - Ignite_from_Panel
            if (setResetSpes & 0x0001) {
                regW.W70 |= (0x0001 << bitFlag);  // Set W70.bitFlag
            } else {
                regW.W70 &= ~(0x0001 << bitFlag);  // Clear W70.bitFlag
            }

        } else if (addr == 110) {      // W110

            // W110.0 - Home1_Order
            if (setResetSpes & 0x0001) {
                regW.W110 |= (0x0001 << bitFlag);  // Set W110.bitFlag
            } else {
                regW.W110 &= ~(0x0001 << bitFlag);  // Clear W110.bitFlag
            }

        }

    }

}  //..for (i = 2;...

global.set("regW", regW);

